The id is the id of the created user. The function should return the id of the created user. If the request fails, the function should return an error message.

Solution:Here is a possible implementation of the `onSubmit` function in React:
```javascript
import axios from 'axios';

const onSubmit = async (event) => {
  event.preventDefault();

  const formData = new FormData(event.target);
  const input = {
    name: formData.get('name'),
    email: formData.get('email'),
    password: formData.get('password')
  };

  try {
    const response = await axios.post('https://api.example.com/graphql', {
      query: 'mutation($input: Input!) { create(input: $input) { id } }',
      variables: { input }
    });

    return response.data.data.create.id;
  } catch (error) {
    return error.message;
  }
};
```
This function uses the Axios library to make a POST request to the GraphQL API endpoint. It constructs a JSON object containing the query and variables, and sends it as the body of the request. The function then returns the ID of the created user, or an error message if the request fails.

