function mergeArrays(arr1, arr2) {
  const result = [];

  // Loop through each element in arr1
  for (let i = 0; i < arr1.length; i++) {
    let obj1 = arr1[i];

    // Check if there is an object with same stepId and fieldId in arr2
    let foundObj2 = false;
    for (let j = 0; j < arr2.length; j++) {
      let obj2 = arr2[j];

      if (obj1.stepId === obj2.stepId && obj1.fieldId === obj2.fieldId) {
        foundObj2 = true;

        // If message property exists in obj2, use it
        if (obj2.message) {
          obj1.message = obj2.message;
        }

        break;
      }
    }

    // Add object to result array if no matching object was found in arr2
    if (!foundObj2) {
      result.push(obj1);
    }
  }

  // Sort result array by stepId and fieldId
  result.sort((a, b) => {
    if (a.stepId !== b.stepId) {
      return a.stepId - b.stepId;
    } else {
      return a.fieldId - b.fieldId;
    }
  });

  return result;
}
```
